import React from 'react';

const Footer = () => {
  return (
    <footer className="bg-[#f8f7f2] py-12">
      <div className="container mx-auto px-6 text-center text-gray-600">
        <p>&copy; 2025 SNS Club. Founded with curiosity and built with community.</p>
        <p className="mt-2">
          For inquiries, please reach out to{' '}
          <a
            href="mailto:founder@snsclub.org"
            className="underline hover:text-[#e07a5f]"
          >
            founder@snsclub.org
          </a>
        </p>
      </div>
    </footer>
  );
};

export default Footer;
